const Pasien = db.define("pasien", {
  id: {
    type: Sequelize.INTEGER,
    primaryKey: true,
    autoIncrement: true,
  },
  nama: {
    type: Sequelize.STRING,
    allowNull: false,
  },
  tgl_lahir: {
    type: Sequelize.DATEONLY,
    allowNull: false,
  },
  gender: {
    type: Sequelize.STRING,
    allowNull: false,
  },
  no_telp: {
    type: Sequelize.STRING,
    allowNull: false,
  },
  alamat: {
    type: Sequelize.STRING,
    allowNull: false,
  },
  id_dokter: {
    type: Sequelize.INTEGER,
    allowNull: false,
    references: {
      model: Dokter,
      key: "id_dokter",
    },
  },
  nama_dokter: {
    type: Sequelize.STRING,
    allowNull: false,
  },
}, {
  tableName: "pasien",
  freezeTableName: true,
  timestamps: false,
});

Pasien.belongsTo(Dokter, { foreignKey: "id_dokter" });
